import React from "react";
import "./Home.css";


const Home = () => {
  return (
    <div className="container">
      <img className="image" src="/photo.png" alt="notfound"/>
      <div className="right">
        <p className="p">Hi, I'm Valentina Barbetty</p>
      <p className="description">Fullstack developer</p>
      <button className="cv-btn">Download my CV</button> <button >Contact Me</button></div>

    </div>
  );
};

export default Home;
